import React,{Component}from 'react';
import axios from 'axios'; 

class App extends Component{
    constructor(props) {
      super(props);
      this.state = {
         data : [{
           name: 'Product'
         },
         {
           name: 'Technology'
         },
         {
           name: 'Uber ATG'
         },
         {
           name: 'Platform Growth & Customer Engagement'
         }]
      }
    }



    render(){
      return(
        <div>
           Uber
           <ul>
             {this.state.data.map((group, index) => {
               return (
                 <li key = {index}>
                      {group.name}
                 </li>
               )
             })}
           </ul>
        </div>
      );
    }
}

export default App;
